               <!-- <li><a href="#skills-testing" role="tab" data-toggle="tab">Testing</a></li> -->\n                    <li><a href="#skills-workflow" role="tab" data-toggle="tab">Workflow</a></li>\n                  </ul>\n                </li>\n                <li><a href="#workflow" role="tab" data-toggle="tab">Developer Toolkit</a></li>\n                <li><a href="#learning" role="tab" data-toggle="tab">Currently Learning</a></li>\n              </ul>\n            </div>\n\n            <div class="tab-content">\n            \n              <!--\n              Basic Services\n              -->\n              <div class="tab-pane active" id="overview">\n                <div class="row">\n                  <div class="col-md-9">\n                    <p class="large">My skill set and expertise evolve around creating web applications from scratch and to a high standard.</p>\n                    <p>Although primarilly a <strong>Front-end Developer</strong>, my experience has also involved significant back-end development too.</p>\n                  </div>\n                </div>\n                <div class="side-by-side-content">\n                  <div class="row">\n                    <div class="side-by-side-content-column col-md-5 col-md-offset-1">\n                      <h3>Basic Services</h3>\n                        <div class="row">\n                          <div class="col-md-12">\n                            <div class="monopoly-card">\n                              <p class="title">Design to Build</p>\n                              <p class="description">Transforming a PSD into HTML, CSS, and JavaScript.</p>\n                              <span class="icon sprite sprite-service-build"></span>\n                            </div>\n                          </div>\n                        </div>\n                        <div class="row">\n                          <div class="col-md-12">\n                            <div class="monopoly-card">\n                              <p class="title">Responsive Development</p>\n                              <p class="description">Delivering the most optimal solution for every device.</p>\n                              <span class="icon sprite sprite-service-responsive"></span>\n                            </div>\n                          </div>\n                        </div>\n                        <div class="row">\n                          <div class="col-md-12">\n                            <div class="monopoly-card">\n                              <p class="title">Server-Side Development</p>\n                              <p class="description">Implementing back-end functional and data requirements.</p>\n                              <span class="icon sprite sprite-service-backend"></span>\n                            </div>\n                          </div>\n                        </div>\n                    </div>\n                    <div class="side-by-side-content-column col-md-5">\n                      <h3>Technical Priorities</h3>\n                      <div class="row">\n                        <div class="col-md-12">\n                          <div class="monopoly-card">\n                            <p class="title">Best Practice Code</p>\n                            <p class="description">Contributing object-oriented, modular, and scalable code.</p>\n                            <span class="icon sprite sprite-service-standards"></span>\n                          </div>\n                        </div>\n                      </div>\n                      <div class="row">\n                        <div class="col-md-12">\n                          <div class="monopoly-card">\n                            <p class="title">Modern Techniques</p>\n                            <p class="description">Keeping aware of and learning new industry innovations.</p>\n                            <span class="icon sprite sprite-service-innovation"></span>\n                          </div>\n                        </div>\n                      </div>\n                      <div class="row">\n                        <div class="col-md-12">\n                          <div class="monopoly-card">\n                            <p class="title">Web Performance</p>\n                            <p class="description">Providing a build process for fast download times.</p>\n                            <span class="icon sprite sprite-service-performance"></span>\n                          </div>\n                        </div>\n                      </div>\n                    </div>\n                  </div>\n                </div>\n              </div>\n\n              <!--\n              Technical Skills\n              -->\n              <div class="tab-pane" id="skills">\n\n                <div class="col-md-3 hidden-xs">\n                  <div class="category-column category-column-whitebg">\n                    <ul class="nav nav-tabs" role="tablist">\n                      <li class="category-column-box active"><a href="#skills-frontend" role="tab" data-toggle="tab">Front-end Development</a></li>\n                      <li class="category-column-box"><a href="#skills-backend" role="tab" data-toggle="tab">Back-end Development</a></li>\n                      <!-- <li class="category-column-box"><a href="#skills-testing" role="tab" data-toggle="tab">Testing</a></li> -->\n                      <li class="category-column-box"><a href="#skills-workflow" role="tab" data-toggle="tab">Workflow</a></li>\n                    </ul>\n                  </div>\n                </div>\n\n                <div class="col-md-9 col-xs-12">\n\n                  <div class="tab-content">\n\n                    <!--\n                    Body - Front-end development\n                    -->\n                    <div class="tab-pane active" id="skills-frontend">\n                      <h3>Front-end Development</h3>\n\n                      <div class="l-content-rows">\n                        <!--\n                        HTML\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-html"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>HTML5 / 4</h4>\n                            <p>\n                              First encountered HTML at an early age, worked with it throughout career.\n                              Strict on keeping the markup void of implied styling in favour of maximum semantic meaning.\n                            </p>\n                            <p>Familiar with HTML5 - new elements, new input types, HTML5 video, etc.</p>\n                          </div>\n                        </div>\n                        <!--\n                        CSS\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-css"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>CSS3 / 2</h4>\n                            <p>\n                              Prefer to use the SMACSS model where possible for good modularity and scalability.\n                              Experienced at troubleshooting cross-browser presentation issues.\n                            </p>\n                            <p>Proficient with media queries and CSS3 animation.</p>\n                          </div>\n                        </div>\n                        <!--\n                        Sass / LESS\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-sass-less"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>Sass / LESS</h4>\n                            <p>Equally capable with both, have used both commercially. Happy with nested styles and inheritance, writing variables, mixins, and functions.</p>\n                          </div>\n                        </div>\n                        <!--\n                        JavaScript\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-javascript"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>JavaScript</h4>\n                            <p>Compentent object-oriented JavaScript developer - functions, objects, classes, prototype, etc.</p>\n                            <p>\n                              Familiar with a range of JS libraries and frameworks such as Backbone.js, jQuery, Require.js, and Underscore.js.\n                              See \'Front-end development\' for more details.\n                            </p>\n                          </div>\n                        </div>\n                        <!--\n                        jQuery\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-jquery"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>jQuery</h4>\n                            <p>Long-standing famliarity. Used to one extent or another on virtually every project.</p>\n                            <p>Have also experimented with jQuery UI on past projects.</p>\n                          </div>\n                        </div>\n                        <!--\n                        Backbone.js\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-backbone"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>Backbone.js</h4>\n                            <p>Excellent understanding and familiarity with the framework - views, models, collections, routers, etc.</p>\n                            <p>\n                              Proficient with extending Backbone classes to suit the need of a given project.\n                              Good awareness of best practices such as structure and organisation, view management, and garbage collection.\n                            </p>\n                          </div>\n                        </div>\n                        <!--\n                        Require.js\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-requirejs"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>Require.js</h4>\n                            <p>Good project experience of using library for modular and optmial architecture.</p>\n                            <p>Familiar with the r.js optimiser, and AMD substitute almond.js, for building require.js apps for production environments.</p>\n                          </div>\n                        </div>\n                        <!--\n                        Foundation / Twitter Bootstrap\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-foundation-bootstrap"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>Foundation / Twitter Bootstrap</h4>\n                            <p>Adept with the grid scaffolding systems of both frameworks to bring about a responsive front-end.</p>\n                            <p>Also experienced with the various CSS/JS components provided, such as the carousel, accordion, tabs, etc, as well as Foundation\'s interchange function for responsive images.</p>\n                          </div>\n                        </div>\n                        <!--\n                        Other JavaScript Libraries\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-javascript"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>Other JavaScript Libraries</h4>\n                            <p>Have often searched for, experimented with, and deployed a range of small popular JS libraries.</p>\n                            <p>A few recent examples: Chosen.js, Moment.js, Chart.js, Progress.js, Owl Carousel, and JWPlayer.</p>\n                          </div>\n                        </div>\n                      </div>\n                    </div>\n\n                    <!--\n                    Body - Back-end development\n                    -->\n                    <div class="tab-pane" id="skills-backend">\n                      <h3>Back-end Development</h3>\n                      <div class="l-content-rows">\n                        \n                        <!--\n                        PHP\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-php"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>PHP</h4>\n                            <p>\n                              Have often been responsible for the full stack of a website with server-side requirements.\n                              Good grasp of Classes, Functions, Scope, Error Handling, etc. See \'Back-end development\' for more details.\n                            </p>\n                          </div>\n                        </div>\n                        <!--\n                        MySQL\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-mysql"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>MySQL</h4>\n                            <p>\n                              Predominantly used MySQL as database solution for PHP projects. Good level of SQL knowledge.\n                              Comfortable managing databases via command line or tools such as Sequel Pro/MySQL Workbench.\n                            </p>\n                          </div>\n                        </div>\n                        <!--\n                        Laravel\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-laravel"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>Laravel</h4>\n                            <p>Good grasp of framework essentials. Competent with writing routes, creating RESTful controllers, views, models, databases, and working with the PHP artisan command line tool.</p>\n                            <p>Have also written unit tests with the in-built PHPUnit library.</p>\n                          </div>\n                        </div>\n                        <!--\n                        CodeIgniter\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-codeigniter"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>CodeIgniter</h4>\n                            <p>Strong commercial experience as CodeIgniter was a standard where I worked for over two years.</p>\n                            <p>Knowledgeable of views, controllers, models, routes, database integration, custom configuration, extending base classes, language translation, etc.</p>\n                          </div>\n                        </div>\n                        <!--\n                        WordPress\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-wordpress"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>WordPress</h4>\n                            <p>Although I\'ve not worked with this CMS recently, I\'ve always been very capable of creating WordPress sites as and when required, and with a quick refresh I could again.</p>\n                          </div>\n                        </div>\n                      </div>\n                    </div>\n\n                    <!--\n                    Body - Testing\n                    -->\n                    <div class="tab-pane" id="skills-testing">\n                      <h3>Testing</h3>\n                    </div>\n\n                    <!--\n                    Workflow\n                    -->\n                    <div class="tab-pane" id="skills-workflow">\n                      <h3>Workflow</h3>\n                      <div class="l-content-rows">\n                        <!--\n                        Git Version Control\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-git"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>Git Version Control</h4>\n                            <p>My predominant source control system for the last three years, previously using SVN. Worked with GitHub and BitBucket repositories.</p>\n                            <p>Familiar with Gitflow model, feature branches, pull requests, hotfixing, etc.</p>\n                          </div>\n                        </div>\n                        <!--\n                        Grunt\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-grunt"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>Grunt</h4>\n                            <p>I use Grunt to automate a range of tasks such as JavaScript linting, compiling Sass/LESS styles, generating spritesheets, browser auto-reloading, etc.</p>\n                            <p>Have recently worked hard to form a complex build process that I now use for all future projects.</p>\n                          </div>\n                        </div>\n                        <!--\n                        JIRA / Confluence\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-jira-confluence"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>JIRA / Confluence</h4>\n                            <p>Know my way around JIRA for Agile development purposes, and Confluence for project documentation purposes.</p>\n                          </div>\n                        </div>\n                        <!--\n                        Adobe Suite\n                        -->\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-adobe"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <h4>Adobe Suite</h4>\n                            <p>Comfortable using Photoshop as a web developer, i.e. navigating around a designer\'s PSD file, exporting images, obtaining typeface information, etc.</p>\n                            <p>Use Fireworks for basic imaging. Have experience with Flash and ActionScript 2.0.</p>\n                          </div>\n                        </div>\n                      </div>\n                    </div>\n                    \n\n                  </div>\n\n                </div>\n              </div>\n\n              <!--\n              Developer Tools\n              -->\n              <div class="tab-pane" id="workflow">\n\n                <div class="l-spaced-rows">\n                  <div class="row">\n                    <div class="col-md-9">\n                      <p class="large">For the benefit of Development Managers and other Developers, below are some of the tools and applications that I am familiar with and use project-to-project where possible:</p>\n                    </div>\n                  </div>\n\n                  <div class="row">\n                    <div class="col-md-3">\n\n                      <div class="icon-grid">\n                        <div class="icon-grid-column">\n                          <div class="icon-grid-item js-icon-select" data-tab="grunt">\n                            <span class="title">Grunt</span>\n                            <span class="icon sprite sprite-tech-grunt-icon"></span>\n                          </div>\n                          <div class="icon-grid-item js-icon-select" data-tab="bower">\n                            <span class="title">Bower/NPM</span>\n                            <span class="icon sprite sprite-tech-bower-icon"></span>\n                          </div>\n                          <div class="icon-grid-item js-icon-select" data-tab="yeoman">\n                            <span class="title">Yeoman</span>\n                            <span class="icon sprite sprite-tech-yeoman-icon"></span>\n                          </div>\n                          <div class="icon-grid-item js-icon-select" data-tab="charles">\n                            <span class="title">Charles</span>\n                            <span class="icon sprite sprite-tech-charles-icon"></span>\n                          </div>\n                        </div>\n                        <div class="icon-grid-column">\n                          <div class="icon-grid-item js-icon-select" data-tab="devtools">\n                            <span class="title">DevTools</span>\n                            <span class="icon sprite sprite-tech-chrome-icon"></span>\n                          </div>\n                          <div class="icon-grid-item js-icon-select" data-tab="sublime">\n                            <span class="title">Sublime Text</span>\n                            <span class="icon sprite sprite-tech-sublime-icon"></span>\n                          </div>\n                          <div class="icon-grid-item js-icon-select" data-tab="commandline">\n                            <span class="title">Command Line</span>\n                            <span class="icon sprite sprite-tech-terminal-icon"></span>\n                          </div>\n                          <div class="icon-grid-item js-icon-select" data-tab="yslow">\n                            <span class="title">YSlow</span>\n                            <span class="icon sprite sprite-tech-yslow-icon"></span>\n                          </div>\n                        </div>\n                      </div>\n\n                    </div>\n                    <div class="col-md-6 hidden-sm hidden-xs js-middle-content-column">\n                      <div class="tab-content">\n                        <div class="tab-pane js-workflow-tab active" id="select">\n                          <h3>Select an icon</h3>\n                        </div>\n                        <!--\n                        Grunt\n                        -->\n                        <div class="tab-pane js-workflow-tab" id="grunt">\n                          <div class="js-modal-content-grunt">\n                            <div class="js-modal-content-header">\n                              <div class="tech-modal-header">\n                                <div class="info-box">\n                                  <a href="http://gruntjs.com" target="_blank">\n                                    <span class="image sprite sprite-tech-grunt-large"></span>\n                                  </a>\n                                  <a class="link" href="http://gruntjs.com" target="_blank">www.gruntjs.com</a>\n                                </div>\n                                <h3>Grunt</h3>\n                                <p class="description large">Automation tool that aids development, testing, and optimisation.</p>\n                                <hr/>\n                              </div>\n                            </div>\n                            <div class="js-modal-content-body">\n                              <div class="tech-modal-body">\n                                <p>I use Grunt for JavaScript linting, compiling Sass/LESS, generating spritesheets, browser auto-reloading, and for other development admin.</p>\n                                <p>But also for building and optimising an app fit for a production environment, involving code concatenation and minification for example.</p>\n                                <p>A few of my favourite Grunt plugins are:</p>\n                                <ul>\n                                  <li><a href="https://github.com/shakyShane/grunt-browser-sync" target="_blank">grunt-browser-sync</a> - Watches code and injects changes into the browser on each target device at once, and keeping them all in sync when navigating</li>\n                                  <li><a href="https://github.com/cbas/grunt-rev" target="_blank">grunt-rev</a> - Appends to asset filenames a unique content-based hash for anti-caching purposes</li>\n                                  <li><a href="https://github.com/Ensighten/grunt-spritesmith" target="_blank">grunt-spritesmith</a> - Generates sprite sheets and CSS based on specified image files</li>\n                                </ul>\n                              </div>\n                            </div>\n                          </div>\n                        </div>\n                        <!--\n                        Chrome DevTools\n                        -->\n                        <div class="tab-pane js-workflow-tab" id="devtools">\n                          <div class="js-modal-content-devtools">\n                            <div class="js-modal-content-header">\n                              <div class="tech-modal-header">\n                                <div class="info-box">\n                                  <a href="https://developer.chrome.com/devtools" target="_blank">\n                                    <span class="image sprite sprite-tech-chrome-large"></span>\n                                  </a>\n                                  <a class="link" href="https://developer.chrome.com/devtools" target="_blank">developer.chrome.com/devtools</a>\n                                </div>\n                                <h3>Chrome DevTools</h3>\n                                <p class="description large">Web debugging toolkit.</p>\n                                <hr/>\n                              </div>\n                            </div>\n                            <div class="js-modal-content-body">\n                              <div class="tech-modal-body">\n                                <p>Familiar with a wide range of the included features, from inspecting the DOM with the Elements tab to inspecting JavaScript memory and performance with the Profiles tab.</p>\n                                <p>Regular user of the Sources and Console tab to debug JavaScript.</p>\n                                <p>Have also used Chrome to debug the DOM on an Android device.</p>\n                              </div>\n                            </div>\n                          </div>\n                        </div>\n                        <!--\n                        Bower\n                        -->\n                        <div class="tab-pane js-workflow-tab" id="bower">\n                          <div class="js-modal-content-bower">\n                            <div class="js-modal-content-header">\n                              <div class="tech-modal-header">\n                                <div class="info-box">\n                                  <a href="http://bower.io" target="_blank">\n                                    <span class="image sprite sprite-tech-bower-large"></span>\n                                  </a>\n                                  <a class="link" href="http://bower.io" target="_blank">bower.io</a>\n                                </div>\n                                <h3>Bower / NPM</h3>\n                                <p class="description large">Package managers that enable easy management of library and framework dependencies.</p>\n                                <hr/>\n                              </div>\n                            </div>\n                            <div class="js-modal-content-body">\n                              <div class="tech-modal-body">\n                                <p>Having used Bower for a couple of years now within development teams, it is a must for keeping developers on the same page.</p>\n                                <p>I use the Node Package Manager (NPM) for similar purposes, but predominantly with respect to development dependencies such as Grunt plugins.</p>\n                              </div>\n                            </div>\n                          </div>\n                        </div>\n                        <!--\n                        Sublime Text\n                        -->\n                        <div class="tab-pane js-workflow-tab" id="sublime">\n                          <div class="js-modal-content-sublime">\n                            <div class="js-modal-content-header">\n                              <div class="tech-modal-header">\n                                <div class="info-box">\n                                  <a href="http://www.sublimetext.com" target="_blank">\n                                    <span class="image sprite sprite-tech-sublime-large"></span>\n                                  </a>\n                                  <a class="link" href="http://www.sublimetext.com" target="_blank">www.sublimetext.com</a>\n                                </div>\n                                <h3>Sublime Text</h3>\n                                <p class="description large">Lightweight code editor.</p>\n                                <hr/>\n                              </div>\n                            </div>\n                            <div class="js-modal-content-body">\n                              <div class="tech-modal-body">\n                                <p>My editor of choice, I like the quick and simple nature of Sublime Text over a more feature rich IDE.</p>\n                                <p>Have also used Webstorm in the past.</p>\n                              </div>\n                            </div>\n                          </div>\n                        </div>\n                        <!--\n                        Yeoman\n                        -->\n                        <div class="tab-pane js-workflow-tab" id="yeoman">\n                          <div class="js-modal-content-yeoman">\n                            <div class="js-modal-content-header">\n                              <div class="tech-modal-header">\n                                <div class="info-box">\n                                  <a href="http://yeoman.io" target="_blank">\n                                    <span class="image sprite sprite-tech-yeoman-large"></span>\n                                  </a>\n                                  <a class="link" href="http://yeoman.io" target="_blank">yeoman.io</a>\n                                </div>\n                                <h3>Yeoman</h3>\n                                <p class="description large">Modern tool for generating boilerplate code to kick-start a new project.</p>\n                                <hr/>\n                              </div>\n                            </div>\n                            <div class="js-modal-content-body">\n                              <div class="tech-modal-body">\n                                <p>More often than not I won\'t use Yeoman to actually provide boilerplate code for a new project, but instead as an insight towards the latest code structures and trends that others have established.</p>\n                                <p>I have however used Yeoman\'s flagship generator in the past, \'webapp-generator\', for use on simple landing pages or very small three to four page static sites.</p>\n                                <p>I am also intrigued by the idea of writing my own Yeoman generators for the purpose of providing a quick route to scaffolding a new project with my own boilerplate code for my own use only.</p>\n                              </div>\n                            </div>\n                          </div>\n                        </div>\n                        <!--\n                        Command Line\n                        -->\n                        <div class="tab-pane js-workflow-tab" id="commandline">\n                          <div class="js-modal-content-commandline">\n                            <div class="js-modal-content-header">\n                              <div class="tech-modal-header">\n                                <div class="info-box">\n                                  <span class="image sprite sprite-tech-terminal-large"></span>\n                                </div>\n                                <h3>Command Line</h3>\n                                <hr/>\n                              </div>\n                            </div>\n                            <div class="js-modal-content-body">\n                              <div class="tech-modal-body">\n                                <p>Very competent navigating around Linux/Unix OS, performing routine file operations.</p>\n                                <p>I predominantly work with Git repositories via command line over tools such as SourceTree and Tower.</p>\n                                <p>As a Mac user I organise my projects and work via command line on a daily basis.</p>\n                              </div>\n                            </div>\n                          </div>\n                        </div>\n                        <!--\n                        Charles\n                        -->\n                        <div class="tab-pane js-workflow-tab" id="charles">\n                          <div class="js-modal-content-charles">\n                            <div class="js-modal-content-header">\n                              <div class="tech-modal-header">\n                                <div class="info-box">\n                                  <a href="http://www.charlesproxy.com" target="_blank">\n                                    <span class="image sprite sprite-tech-charles-large"></span>\n                                  </a>\n                                  <a class="link" href="http://www.charlesproxy.com" target="_blank">charlesproxy.com</a>\n                                </div>\n                                <h3>Charles</h3>\n                                <p class="description large">Web debugging, monitoring, and proxy tool.</p>\n                                <hr/>\n                              </div>\n                            </div>\n                            <div class="js-modal-content-body">\n                              <div class="tech-modal-body">\n                                <p>I have benefited a lot from using Charles not only as a HTTP Monitor, for which there are many tools, but also as a means to develop apps with external dependencies.</p>\n                                <p>For example, using Charles\' proxy functionality on a recent project, I have been able to redirect requests to an external live video stream (.m3u8 file) to a local version of this file, in order to change the contents of it for experiment and testing purposes.</p>\n                                <p>Furthermore, using the throttling feature it is very easy to test the performance of a site under a limited Internet connection.</p>\n                              </div>\n                            </div>\n                          </div>\n                        </div>\n                        <!--\n                        YSlow\n                        -->\n                        <div class="tab-pane js-workflow-tab" id="yslow">\n                          <div class="js-modal-content-yslow">\n                            <div class="js-modal-content-header">\n                              <div class="tech-modal-header">\n                                <div class="info-box">\n                                  <a href="https://developer.yahoo.com/yslow" target="_blank">\n                                    <span class="image sprite sprite-tech-yslow-large"></span>\n                                  </a>\n                                  <a class="link" href="#" target="_blank">developer.yahoo.com/yslow</a>\n                                </div>\n                                <h3>YSlow</h3>\n                                <p class="description large">Analysis tool for measuring the level of optimisation.</p>\n                                <hr/>\n                              </div>\n                            </div>\n                            <div class="js-modal-content-body">\n                              <div class="tech-modal-body">\n                                <p>Relevant to one of my key interests, web performance, I very often rely on YSlow as a standard to judge whether or not basic principles for good web performance has been implemented or not.</p>\n                                <p>This helps in providing a checklist for developing my own sites, but also a means to assess others.</p>\n                                <p>In addition, I often call upon other tools to help enhance web performance such as Google <a href="https://developers.google.com/speed/pagespeed/insights" target="_blank">PageSpeed Insights</a> and <a href="http://www.webpagetest.org" target="_blank">webpagetest.org</a>.</p>\n                              </div>\n                            </div>\n                          </div>\n                        </div>\n                        <!--\n                        VirtualBox\n                        -->\n                        <div class="tab-pane js-workflow-tab" id="virtualbox">\n                          <div class="js-modal-content-virtualbox">\n                            <div class="js-modal-content-header">\n                              <div class="tech-modal-header">\n                                <div class="info-box">\n                                  <a href="https://www.virtualbox.org" target="_blank">\n                                    <span class="image sprite sprite-tech-virtualbox-large"></span>\n                                  </a>\n                                  <a class="link" href="https://www.virtualbox.org" target="_blank">virtualbox.org</a>\n                                </div>\n                                <h3>VirtualBox</h3>\n                                <p class="description large">Tool for setting up a virtual environment.</p>\n                                <hr/>\n                              </div>\n                            </div>\n                            <div class="js-modal-content-body">\n                              <div class="tech-modal-body">\n                                <p>My number one port of call when undertaking cross-browser testing especially in relation to Internet Explorer.</p>\n                                <p>Downloading the necessary installation files from the <a href="http://www.modern.ie" target="_blank">modern.ie</a> website, developers can test applications in any version of IE including as far back as IE6.</p>\n                              </div>\n                            </div>\n                          </div>\n                        </div>\n                        <!--\n                        BrowserStack\n                        -->\n                        <div class="tab-pane js-workflow-tab" id="browserstack">\n                          <div class="js-modal-content-browserstack">\n                            <div class="js-modal-content-header">\n                              <div class="tech-modal-header">\n                                <div class="info-box">\n                                  <a href="http://www.browserstack.com" target="_blank">\n                                    <span class="image sprite sprite-tech-browserstack-large"></span>\n                                  </a>\n                                  <a class="link" href="http://www.browserstack.com" target="_blank">browserstack.com</a>\n                                </div>\n                                <h3>BrowserStack</h3>\n                                <p class="description large">Online virtual environments for testing purposes.</p>\n                                <hr/>\n                              </div>\n                            </div>\n                            <div class="js-modal-content-body">\n                              <div class="tech-modal-body">\n                                <p>I\'m a big fan of BrowserStack as I appreciate the "all under one roof" approach in providing almost every browser and every mobile device to test with.</p>\n                                <p>The big advantage is that it\'s much easier and quicker to start testing. The big drawback however is the subsequent speed of the service waiting for pages to render, which isn\'t always great.</p>\n                                <p>But other features including the ability to acquire specially prepared screenshots to share with others is very useful, helping to provide assurance to other stakeholders.</p>\n                              </div>\n                            </div>\n                          </div>\n                        </div>\n                        <!--\n                        Git\n                        -->\n                        <div class="tab-pane js-workflow-tab" id="git">\n                          <div class="js-modal-content-git">\n                            <div class="js-modal-content-header">\n                              <div class="tech-modal-header">\n                                <div class="info-box">\n                                  <a href="http://git-scm.com" target="_blank">\n                                    <span class="image sprite sprite-tech-git-large"></span>\n                                  </a>\n                                  <a class="link" href="http://git-scm.com" target="_blank">git-scm.com</a>\n                                </div>\n                                <h3>Git</h3>\n                                <p class="description large">Distributed version control system.</p>\n                                <hr/>\n                              </div>\n                            </div>\n                            <div class="js-modal-content-body">\n                              <div class="tech-modal-body">\n                                <p>My predominant source control system for the last three years, previously using SVN.</p>\n                                <p>Knowledgeable of branches, merging, rebasing, stashing, pull requests, submodules, subtrees, and more.</p>\n                                <p>Preferring to work with Git via command line I am familiar with a wide range of Git commands.</p>\n                              </div>\n                            </div>\n                          </div>\n                        </div>\n                        <!--\n                        BitBucket\n                        -->\n                        <div class="tab-pane js-workflow-tab" id="bitbucket">\n                          <div class="js-modal-content-bitbucket">\n                            <div class="js-modal-content-header">\n                              <div class="tech-modal-header">\n                                <div class="info-box">\n                                  <a href="https://bitbucket.org" target="_blank">\n                                    <span class="image sprite sprite-tech-bitbucket-large"></span>\n                                  </a>\n                                  <a class="link" href="https://bitbucket.org" target="_blank">bitbucket.org</a>\n                                </div>\n                                <h3>BitBucket</h3>\n                                <p class="description large">Git repository platform.</p>\n                                <hr/>\n                              </div>\n                            </div>\n                            <div class="js-modal-content-body">\n                              <div class="tech-modal-body">\n                                <p>Have worked with BitBucket predominantly over the last year and am very familiar with the user interfce.</p>\n                                <p>Happy with reporting issues and submitting/responding to pull requests.</p>\n                              </div>\n                            </div>\n                          </div>\n                        </div>\n                        <!--\n                        Gitflow\n                        -->\n                        <div class="tab-pane js-workflow-tab" id="gitflow">\n                          <div class="js-modal-content-gitflow">\n                            <div class="js-modal-content-header">\n                              <div class="tech-modal-header">\n                                <div class="info-box">\n                                  <a href="http://nvie.com/posts/a-successful-git-branching-model" target="_blank">\n                                    <span class="image sprite sprite-tech-git-large"></span>\n                                  </a>\n                                  <a class="link" href="http://nvie.com/posts/a-successful-git-branching-model" target="_blank">nvie.com</a>\n                                </div>\n                                <h3>Gitflow</h3>\n                                <p class="description large">Git repository workflow model.</p>\n                                <hr/>\n                              </div>\n                            </div>\n                            <div class="js-modal-content-body">\n                              <div class="tech-modal-body">\n                                <p>Less of a tool, more of a methodology, I am very familiar with managing Git repositories in this way.</p>\n                                <p>Good understanding of all aspects such as features branches, release branches, hotfixing, develop/master branch, etc.</p>\n                                <p>Ready to work within Gitflow environment if needed.</p>\n                              </div>\n                            </div>\n                          </div>\n                        </div>\n                        <!--\n                        Confluence\n                        -->\n                        <div class="tab-pane js-workflow-tab" id="confluence">\n                          <div class="js-modal-content-confluence">\n                            <div class="js-modal-content-header">\n                              <div class="tech-modal-header">\n                                <div class="info-box">\n                                  <a href="https://www.atlassian.com/software/confluenc" target="_blank">\n                                    <span class="image sprite sprite-tech-confluence-large"></span>\n                                  </a>\n                                  <a class="link" href="https://www.atlassian.com/software/confluenc" target="_blank">atlassian.com/software/confluence</a>\n                                </div>\n                                <h3>Confluence</h3>\n                                <p class="description large">Documentation system.</p>\n                                <hr/>\n                              </div>\n                            </div>\n                            <div class="js-modal-content-body">\n                              <div class="tech-modal-body">\n                                <p>As a big fan of Atlassian Confluence, I introduced the system to DNX Marketing the agency that I worked for in the last permanent position that I held, and they have since continued to use it.</p>\n                                <p>I have since encountered Confluence elsewhere and always make a special effort to contribute project documentation for the benefit of future developers and other stakeholders.</p> \n                              </div>\n                            </div>\n                          </div>\n                        </div>\n                        <!--\n                        GitHub\n                        -->\n                        <div class="tab-pane js-workflow-tab" id="github">\n                          <div class="js-modal-content-github">\n                            <div class="js-modal-content-header">\n                              <div class="tech-modal-header">\n                                <div class="info-box">\n                                  <a href="https://github.com" target="_blank">\n                                    <span class="image sprite sprite-tech-github-large"></span>\n                                  </a>\n                                  <a class="link" href="https://github.com" target="_blank">github.com</a>\n                                </div>\n                                <h3>GitHub</h3>\n                                <p class="description large">Git repository platform.</p>\n                                <hr/>\n                              </div>\n                            </div>\n                            <div class="js-modal-content-body">\n                              <div class="tech-modal-body">\n                                <p>Like any developer I am very familiar with browsing GitHub repositories as an access to open source software.</p>\n                                <p>Perfectly comfortable reporting issues and submitting/responding to pull requests.</p>\n                              </div>\n                            </div>\n                          </div>\n                        </div>\n                        <!--\n                        JIRA\n                        -->\n                        <div class="tab-pane js-workflow-tab" id="jira">\n                          <div class="js-modal-content-jira">\n                            <div class="js-modal-content-header">\n                              <div class="tech-modal-header">\n                                <div class="info-box">\n                                  <a href="https://www.atlassian.com/software/jira" target="_blank">\n                                    <span class="image sprite sprite-tech-jira-large"></span>\n                                  </a>\n                                  <a class="link" href="https://www.atlassian.com/software/jira" target="_blank">atlassian.com/software/jira</a>\n                                </div>\n                                <h3>JIRA</h3>\n                                <p class="description large">Project tracking platform.</p>\n                                <hr/>\n                              </div>\n                            </div>\n                            <div class="js-modal-content-body">\n                              <div class="tech-modal-body">\n                                <p>Familiar with working within an Agile environment via JIRA.</p>\n                                <p>Happy with managing tasks on the job board, commenting on issues, reporting time spent/left, associating Git branches with jobs, etc.</p>\n                              </div>\n                            </div>\n                          </div>\n                        </div>\n                      </div>\n                    </div>\n                    <div class="col-md-3">\n\n                      <div class="icon-grid">\n                        <div class="icon-grid-column">\n                          <div class="icon-grid-item js-icon-select" data-tab="virtualbox">\n                            <span class="title">VirtualBox</span>\n                            <span class="icon sprite sprite-tech-virtualbox-icon"></span>\n                          </div>\n                          <div class="icon-grid-item js-icon-select" data-tab="git">\n                            <span class="title">Git</span>\n                            <span class="icon sprite sprite-tech-git-icon"></span>\n                          </div>\n                          <div class="icon-grid-item js-icon-select" data-tab="gitflow">\n                            <span class="title">Gitflow</span>\n                            <span class="icon sprite sprite-tech-git-icon"></span>\n                          </div>\n                          <div class="icon-grid-item js-icon-select" data-tab="github">\n                            <span class="title">GitHub</span>\n                            <span class="icon sprite sprite-tech-github-icon"></span>\n                          </div>\n                        </div>\n                        <div class="icon-grid-column">\n                          <div class="icon-grid-item js-icon-select" data-tab="browserstack">\n                            <span class="title">BrowserStack</span>\n                            <span class="icon sprite sprite-tech-browserstack-icon"></span>\n                          </div>\n                          <div class="icon-grid-item js-icon-select" data-tab="bitbucket">\n                            <span class="title">BitBucket</span>\n                            <span class="icon sprite sprite-tech-bitbucket-icon"></span>\n                          </div>\n                          <div class="icon-grid-item js-icon-select" data-tab="confluence">\n                            <span class="title">Confluence</span>\n                            <span class="icon sprite sprite-tech-confluence-icon"></span>\n                          </div>\n                          <div class="icon-grid-item js-icon-select" data-tab="jira">\n                            <span class="title">JIRA</span>\n                            <span class="icon sprite sprite-tech-jira-icon"></span>\n                          </div>\n                        </div>\n                      </div>\n                    \n                    </div>\n                  </div>\n\n                </div>\n\n              </div>\n\n              <!--\n              Currently Learning\n              -->\n              <div class="tab-pane" id="learning">\n\n                <div class="l-spaced-rows">\n                  <div class="row">\n                    <div class="col-md-12">\n                      <p class="large">As a passionate and determined web developer, I always have two or three major learning objectives that I work towards in my spare time. Currently they are:</p>\n                    </div>\n                  </div>\n                  <div class="side-by-side-content row">\n                    <div class="side-by-side-content-column col-md-6">\n                      <span class="image sprite sprite-tech-angularjs-large"></span>\n                      <p class="text-left">\n                        Currently the JavaScript MVC framework that I am experienced with is <em>Backbone.js</em>. The reason for this is because Backbone\n                        was the first JS framework that I encountered and I really liked the instant MVC structure that it enforces.\n                      </p>\n                      <p class="text-left">\n                        However, AngularJS for a while now seems to have taken the lead at least in terms of popularity. But more importantly, the general wisdom\n                        seems to be that choosing a particular framework over another depends on the project at hand - rather than the result of any direct comparisons.\n                      </p>\n                      <p class="text-left">\n                        I would therefore like to further extend my resourcefulness and flexibility by adding AngularJS to my arsenal.\n                      </p>\n                      <p class="text-left">\n                        It is my intention in the very near future, as a learning exercise, to create a separate branch of this website built with AngularJS\n                        rather than Backbone.js.\n                      </p>\n                    </div>\n                    <div class="side-by-side-content-column col-md-6">\n                      <span class="image sprite sprite-tech-phonegap-large"></span>\n                      <p class="text-left">\n                        As part of my overall objective of becoming a <em>complete</em> developer, or as close to this as it is possible at any one point in time,\n                        I would like to possess a mobile app development capability.\n                      </p>\n                      <p class="text-left">\n                        I think that it\'s obvious to say that a developer who can offer mobile apps, rather than just responsive websites, can instantly become double\n                        the asset that they were previously for any given company.\n                      </p>\n                      <p class="text-left">\n                        Furthermore, for the last several months I have been working on a concept, as well as UI wireframes and technical architecture, for an ambitious mobile app that\n                        I intend to build and sell as a product of a new business.\n                      </p>\n                      <p class="text-left">\n                        I have chosen PhoneGap as the platform that will box the project as a mobile app, and with the learning materials that I have acquired I will soon\n                        begin work on an early prototype.\n                      </p>\n                    </div>\n                  </div>\n                  <div class="row">\n                    <div class="col-md-12">\n                      <h3>Also on the radar:</h3>\n                      <div class="l-content-rows">\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-coffeescript-large"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <p>\n                              Having experimented with writing CoffeeScript, I really appreciate the stripped back, simplified, and quick-to-read JavaScript that CoffeeScript brings about.\n                              As a learning exercise I\'m keen to re-write this website using CoffeeScript and keep it on a separate branch.\n                            </p>\n                          </div>\n                        </div>\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-nodejs-large"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <p>\n                              Node.js is obviously a bit of a revolution in the JavaScript world with respect to more efficient server-side processing. Given its growing popularity and\n                              adoption in various industries, I intend to be able to provide a Node.js service in the future.\n                            </p>\n                          </div>\n                        </div>\n                        <div class="row">\n                          <div class="col-md-2">\n                            <span class="sprite sprite-tech-mongodb-large"></span>\n                          </div>\n                          <div class="col-md-10">\n                            <p>\n                              A very popular alternative database solution, MongoDB seems to have propelled the NoSQL movement forwards somewhat. As someone who has always met these\n                              requirements previously with PHP &amp; MySQL, I would like to adapt and add a NoSQL string to my bow.\n                            </p>\n                          </div>\n                        </div>\n                      </div>\n                    </div>\n                  </div>\n                </div>\n\n              </div>\n\n            </div>\n\n        </div>\n      </div>\n    </div>\n\n  </div>\n\n</div>'}),define("views/skills",["jquery","underscore","backbone","views/_base","text!../../templates/skills.html","bootstraptab"],function(e,t,n,r,i){var s=r.extend({id:"skills",template:t.template(i),background:"gold",theme:"red",events:{"click .js-icon-select":"onWorkflowBoxClick"},onWorkflowBoxClick:function(t){var n=this.identifyClickedBox(t),r=n.attr("data-tab");e(".js-middle-content-column").css("display")!=="none"?(this.setActive(n),this.changeContent(r)):this.showModal(r)},setActive:function(t){e(".js-icon-select").removeClass("is-active"),t.toggleClass("is-active")},changeContent:function(t){e(".js-workflow-tab").hide(),e("#"+t).show()}});return s}),define("text!views/../../templates/recruitment.html",[],function(){return'<!--\nTemplate - Employment\n-->\n<div class="page-container is-hidden js-fadein">\n\n  <div class="row">\n    <div class="col-md-12">\n      <article class="content-canvas theme-border decor-recruitment">\n        <h2>Recruitment</h2>\n\n        <div class="row">\n          <div class="col-md-6">\n\n            <h3>Current Availability</h3>\n            <!--\n            Radio buttons\n            -->\n            <div class="checkboxes">\n              <div class="checkboxes-item is-off">\n                <i class="sprite sprite-checkbox-off"></i>\n                <span>Yes. I am currently active in the job market looking for a new contract.</span>\n              </div>\n              <div class="checkboxes-item is-on">\n                <i class="sprite sprite-checkbox-on"></i>\n                <span>No. I am <strong>not</strong> seeking a new contract at this time.</span>\n              </div>\n            </div>\n          </div>\n          <div class="col-md-6">\n            <!--\n            Contract Criteria\n            -->\n            <h3>Contract Criteria</h3>\n            <table class="formatted-table formatted-table-fullwidth">\n              <thead>\n                <td>Daily Rate</td>\n                <td>Preferred Length</td>\n                <td>Location</td>\n                <td>Travel</td>\n              </thead>\n              <tbody>\n                <td>&pound;400 p/d</td>\n                <td>1-4 months</td>\n                <td>London, Surrey</td>\n                <td>Car, Train</td>\n              </tbody>\n            </table>\n            <p><strong>Interested Roles</strong>: Front-end Developer, Full Stack Developer</p>\n          </div>\n\n        </div>\n        <div class="row">\n          <div class="col-md-12">\n            <!--\n            Current/Last Contrat\n            -->\n            <hr/>\n            <h3>Last Contract</h3>\n            <p>15th May - 10th October 2014 &nbsp;<span class="secondary-caption">3 month contract extended</span></p><br/>\n            <div class="info-box info-box-left">\n              <a href="http://www.capablue.com" target="_blank">\n                  <span class="image sprite sprite-company-capablue"></span>\n              </a>\n              <a class="link" href="http://www.capablue.com" target="_blank">www.capablue.com</a>\n              <p class="caption caption-centre">London, Waterloo</p>\n            </div>\n            <h4>Summary</h4>\n            <p>Role: Front-end Developer</p>\n            <p>Technologies: HTML5, CSS3, Sass, Foundation, JavaScript, jQuery, Backbone.js, Require.js, JSON, PHP</p>\n            <p>See <a href="/#cv">CV</a> for more details.</p>\n            <p>Drafted in to develop a white-label product for a new multi-channel live TV streaming web application accessible on desktops, tablets, and mobile devices (similar concept to BBC iPlayer).</p>\n            <p>Subsequently I was asked to build from scratch a new version of the Capablue company website. The new site can be seen at www.capablue.com.</p>\n          </div>\n        </div>\n\n      </article>\n    </div>\n  </div>\n\n</div>'}),define("views/recruitment",["underscore","views/_base","text!../../templates/recruitment.html"],function(e,t,n){var r=t.extend({id:"recruitment",template:e.template(n),background:"purple",theme:"green"});return r}),define("text!views/../../templates/feedback.html",[],function(){return'<!--\nTemplate - Job Feedback\n-->\n<div class="page-container is-hidden js-fadein">\n\n  <div class="row">\n    <div class="col-md-12">\n\n      <article class="content-canvas theme-border decor-feedback">\n\n        <h2>Job Feedback</h2>\n        <div class="row">\n          <div class="col-lg-9 col-md-8 col-sm-7 col-xs-12">\n            <p class="large">The following recommendations were originally written and published on <a href="http://uk.linkedin.com/in/chrismendes" target="_blank">my LinkedIn page</a> where they still are and where they can be verified.</p>\n            <p class="secondary-caption">Note: While the individuals below are senior members within their respective environment, they are <strong>not</strong> responsible for company recruitment and have no interest in responding to any such enquiries.</p>\n          </div>\n        </div>\n\n        <div class="row">\n          <div class="col-md-12">\n            <section class="l-content-rows">\n\n              <div class="row">\n                <div class="col-md-12">\n                  <div class="company-heading media">\n                    <a class="company-logo" href="http://www.capablue.com" target="_blank">\n                      <span class="image sprite sprite-company-capablue"></span>\n                      <span class="image image-phone sprite sprite-company-capablue-small"></span>\n                    </a>\n                    <div class="media-body">\n                      <h3>Capablue</h3>\n                      <p>\n                        Contract Front-end Developer<br/>\n                        <span class="secondary-caption">May 2014 - October 2014</span>\n                      </p>\n                    </div>\n                  </div>\n                </div>\n              </div>\n\n              <!--\n              Capablue - Pete\n              -->\n              <div class="row">\n                <div class="col-md-12">\n                  <div class="person-box">\n                    <div class="media">\n                      <span class="person-photo sprite sprite-person-petethompson"></span>\n                      <div class="media-body">\n                        <p class="person-name">Pete Thompson</p>\n                        <p class="person-jobtitle">Solutions Architect at Capablue</p>\n                      </div>\n                    </div>\n                  </div>\n                  <p class="secondary-caption">14th October 2014</p>\n                  <p>"I worked with Chris for a period of four months on the implementation of a live video streaming application and the Capablue corporate website. The projects required a comprehensive understanding of modern JavaScript development and responsive web design.</p>\n                  <p>Chris was the principal developer on both projects and demonstrated that he can work independently and be trusted to deliver consistently high-quality work. He also demonstrated his ability to manage the work of others and mentor more junior members of the team.</p>\n                  <p>Chris is an excellent frontend developer with an astonishing attention to detail who frequently goes above and beyond what is required. He is a pleasure to work with, and I would not hesitate to recommend him."</p>\n                </div>\n              </div>\n\n              <!--\n              Capablue - Andy\n              -->\n              <div class="row">\n                <div class="col-md-12">\n                  <div class="person-box">\n                    <div class="media">\n                      <span class="person-photo sprite sprite-person-andyroberts"></span>\n                      <div class="media-body">\n                        <p class="person-name">Andy Roberts</p>\n                        <p class="person-jobtitle">Project Manager at Capablue</p>\n                      </div>\n                    </div>\n                  </div>\n                  <p class="secondary-caption">14th July 2014</p>\n                  <p>"I managed Chris for 2 months on an Agile project to create a TV Everywhere video player. Chris worked tirelessly to deliver this to a tight deadline using his strong java script knowledge and experience in creating adaptive websites.</p>\n                  <p>He was a key team player over this period and significantly contributed to making the project a success. I have no hesitation in recommending him."</p>\n                </div>\n              </div>\n\n              <div class="row">\n                <div class="col-md-12">\n                  <div class="company-heading media">\n                    <a class="company-logo" href="http://www.dnxmarketing.com" target="_blank">\n                      <span class="image sprite sprite-company-dnx"></span>\n                      <span class="image image-phone sprite sprite-company-dnx-small"></span>\n                    </a>\n                    <div class="media-body">\n                      <h3>DNX Marketing</h3>\n                      <p>\n                        Web Developer<br/>\n                        <span class="secondary-caption">March 2012 - May 2014</span>\n                      </p>\n                    </div>\n                  </div>\n                </div>\n              </div>\n\n              <!--\n              DNX - Laurence\n              -->\n              <div class="row">\n                <div class="col-md-12">\n                  <div class="person-box">\n                    <div class="media">\n                      <span class="person-photo sprite sprite-person-laurencejones"></span>\n                      <div class="media-body">\n                        <p class="person-name">Laurence Jones</p>\n                        <p class="person-jobtitle">Project Manager at DNX</p>\n                      </div>\n                    </div>\n                  </div>\n                  <p class="secondary-caption">16th June 2014</p>\n                  <p>"I worked with Chris at DNX for a six month period. I found Chris to be a dedicated and committed programmer. He is not just interested in the job at hand.</p>\n                  <p>Chris has a genuine interest in examining frameworks, processes and industry innovations that can positively contribute to project work. Chris is a natural lead programmer - he brings a high level of digital insight to the scoping and planning process and is conscientious enough to give up his own time to troubleshoot project bugs and guarantee delivery when necessary.</p>\n                  <p>In summary, Chris is a highly capable and insightful developer and I have no hesitation in highly recommending him."</p>\n                </div>\n              </div>\n              <!--\n              DNX - Cathy\n              -->\n              <div class="row">\n                <div class="col-md-12">\n                  <div class="person-box">\n                    <div class="media">\n                      <span class="person-photo sprite sprite-person-cathybishop"></span>\n                      <div class="media-body">\n                        <p class="person-name">Cathy Bishop</p>\n                        <p class="person-jobtitle">Account Director at DNX</p>\n                      </div>\n                    </div>\n                  </div>\n                  <p class="secondary-caption">13th June 2014</p>\n                  <p>"I worked with Chris on a number of projects at DNX and found him a real pleasure to work with. He patiently explained the more technical dev issues, produced great work and was always happy to go the extra mile.</p>\n                  <p>Snap him up, he\'s worth his weight in gold!"</p>\n                </div>\n              </div>\n              <!--\n              DNX - Tom\n         